  enum UDS_ResetSubFunction reset_type = data[1];

  if (reset_type != UDS_RESET_HARD) {
    send_negative_response(data[0], UDS_NRC_UNSUPPORTED_REQUEST);
    return;
  }

  send_positive_response(data[0]);
  system_reboot();
}

